What is printed to console.log?

var janeGenerator = function () {
    var p = new Promise(function (resolve, reject) {
        setTimeout(function () {
            if (Math.random() > 0.5) {
                resolve({
                    name: "Jane"
                })
            } else {
                reject({
                    name: "Jane"
                })
            }
        }, 1000);
    });
    return p;
};

janeGenerator().then(function (o) {
    o.job = "CEO";
    return o;
}, function (o) {
    o.job = "VP";
    return o;
}).then(function (o) {
    o.house = "Big";
    return o;
}).then(function (o) {
    console.log(o.name, o.job, o.house);
}).catch(function (o) {
    console.log(o.name, o.job);
});

